tsTypes.Header:
export type Header = {
    name: string;
  value: string;
};

tsTypes.WebViewAttrs:
export type WebViewAttrs = {
    userAgent: string | undefined | null;
  visible: boolean;
  transparent: boolean;
  backgroundColor: Rgba | undefined | null;
  zoomHotkeysEnabled: boolean;
  initializationScripts: Array<string>;
  clipboard: boolean;
  devtools: boolean;
  acceptFirstMouse: boolean;
  backForwardNavigationGestures: boolean;
  incognito: boolean;
  autoplay: boolean;
  html: string | undefined | null;
  url: string | undefined | null;
  headers: Array<Header> | undefined | null;
};

tsTypes.FileDialogOptions:
export type FileDialogOptions = {
    location: string;
  filename: string;
  typ: FileOpenerType;
};

tsTypes.WindowAttrs:
export type WindowAttrs = {
    innerSize: Size | undefined | null;
  minHeight: number | undefined | null;
  maxHeight: number | undefined | null;
  minWidth: number | undefined | null;
  maxWidth: number | undefined | null;
  resizable: boolean;
  minimizable: boolean;
  maximizable: boolean;
  closable: boolean;
  title: string;
  maximized: boolean;
  visible: boolean;
  transparent: boolean;
  decorations: boolean;
  alwaysOnTop: boolean;
  alwaysOnBottom: boolean;
  windowIcon: string | undefined | null;
  theme: Theme;
  focused: boolean;
  contentProtection: boolean;
  visibleOnAllWorkspaces: boolean;
  position: Position | undefined | null;
};

tsTypes.Size:
export type Size = {
    height: number;
  width: number;
};

tsTypes.Position:
export type Position = {
    x: number;
  y: number;
};

tsTypes.Rgba:
export type Rgba = {
    r: number;
  g: number;
  b: number;
  a: number;
};
